import React from 'react';
import PersonCard from './PersonCard';

const PersonList = ({ people, onEdit, onDelete }) => {
  return (
    <div>
      <h2>Lista de Pessoas</h2>
      <div className="person-list">
        {people.map((person) => (
          <PersonCard
            key={person.id}
            person={person}
            onEdit={onEdit}
            onDelete={onDelete}
          />
        ))}
      </div>
    </div>
  );
};

export default PersonList;
